import logo from './logo.svg';
import './App.css';
import Home from './pages/Home'
import { BrowserRouter as Router, Route, Routes, Link, Switch} from "react-router-dom"; 
import NavBar from './components/NavBar'

function App() {
  return (
    <div className="App">

        <Router>
          <NavBar/>
          <Switch>
            <Routes>
              <Route path='/' element={<Home />} />

            </Routes></Switch>
          </Router>
    </div>
  );
}

export default App;
